  for (let i = 0; i < data.directions.length; i++) {
    bars.append('rect')
      .attr('width', BAR_WIDTH)
      .attr('x', directionsScale(data.directions[i]) - BAR_WIDTH / 2)
      .attr('height', dataScale.range()[0] - dataScale.range()[1] + FONT_SIZE)
      .attr('y', MARGIN.top)
      .attr('fill', 'transparent')
