        d3.selectAll(`.direction${i}.label`)
          .attr('font-weight', 1000)
        d3.selectAll(`.direction${i}.quantile`)
          .style('visibility', 'visible')
      // Unhighlight direction
      }).on('mouseout', () => {
        d3.selectAll(`.direction${i}`)
          .attr('stroke-width', QUANTILE_STROKE_WIDTH)
        d3.selectAll(`.direction${i}.label`)
          .attr('font-weight', 0)
        d3.selectAll(`.direction${i}.quantile`)
